  def "test isJ2Prime"(){
    given:
    def max = J2P[J2P.length-1] + 1
    int items = J2P.length
    def results = []

    when: 
    for (i in 2..<max) {
      if(Util.isJ2Prime(i)){
        results << i
      }
    }
    then:
    J2P[0..<items] == results
  }

  def "test findNextLowestJ2Prime"(){
    given:
    def max = J2P[J2P.length-1] + 1
    int items = J2P.length
    def results = []

    when:
    int last = Integer.MAX_VALUE
    for(i in 2..<max) {
      int next = Util.findNextLowestJ2Prime(i)
      if(next != last){
        results << next
      }
      last = next
    }
    then:
    J2P[0..<items] == results
  }

  def "test fastmod"(){
    expect:
    int x = 1234
    int d = 7
    int pd = Math.abs(d)
    long u64c = Long.divideUnsigned(-1L, pd) + 1L
//         + ((pd & (pd-1L))==0 ? 1L : 0);

    for (i in 0..<1000000) {
      x = Math.abs(31 * x + 27961)
//      println(x + ", "+ d)
      verifyAll {
        assertEquals(x % d, Util.fastmod(x, u64c, pd))
      }
    }
  }
}
